import React from 'react';
import ServiceCard from './ServiceCard';
import Data from './Data';

const Service = () => {
  return (
    <div className='container'>
    <div className="row"></div>
      {Data.map((service) => (
        <ServiceCard key={service.id} service={service} />
      ))}
    </div>
  );
};

export default Service;
